/**************************************************************
 *
 *	init bg gradient effect on canvas
 *
****************************************************************/
function initGradient(){

	    	granimInstance = new Granim({
			   	element: '#bg-gradient',
			   	name: 'granim',
			   	opacity: [0, 1],
			   	stateTransitionSpeed: 1000,
			   	isPausedWhenNotInView: true,
			   	states : {
			       
			       "default-state": {
			           gradients: [
			               	['#280045', '#280045']	            
			           ]
			       },

			       "matrixPG-state": {
			           gradients: [
			               	['#002869', '#AE1D14']
			           ]
			       },

			       "matrixUG-state": {
			           gradients: [
			               	['#060292', '#060292']
			           ]
			       }			      
			       
			   }
			});

}
/**************************************************************
 *
 *	set the gradient canvas dimensions
 *
****************************************************************/
function setGranimCanvasDim( canvasW, canvasH ){

	var isCanvasSet = false;

	bgGradient.width = canvasW;
	bgGradient.height = canvasH;

	if( bgGradient.height ===  verge.viewportH() ){
		isCanvasSet = true;
	}

	return isCanvasSet;

}
/**************************************************************
 *
 *	init the karandak theme with canvas gradient initialization
 *
****************************************************************/
function initTheme(vpW, vpH){	

		if( setGranimCanvasDim(vpW, vpH) ){
			
			if( granimInstance === undefined ){
				initGradient();
			}

		}
}
