jQuery(document).ready(function($) {

	// init : gradient
	if( bgGradient !== undefined ){
		vw = verge.viewportW();
		vh = verge.viewportH();
		initTheme(vw,vh);
	}

	// init : fullpage
	if( granimInstance !== undefined ){

		fullpage = $('#fullpage');
		verticalNavs = $('.wrapper-vertical-nav .vertical-nav a');	
		revElements = $('.eventDate, .eventTitle, .eventDesc, .eventRegister')

		if( fullpage !== undefined ){
			initFullpage( fullpage, verticalNavs, revElements );
		}

	}

	// verticla line animations
	initVerticalLineAnimations();

	//init perfect scroll bar
	if( miscContainer !== undefined ){
		Ps.initialize(miscContainer);
	}

	// init : particles	
	if( particlesContainer !== undefined ){
		initParticles();
	}

	// load js
	if( pgLoader !== undefined ){
		updatePgLoading();
	}



});
